import React from "react";
import { Link } from "react-router-dom";
//import { BrowserRouter, Route, Link } from "react-router-dom";

class Sidebar extends React.Component {
    render() {
        return (
                <div>
                    <ul class="nav flex-column sticky-top pt-2 mt-3">
                        <li class="nav-item"><Link class="nav-link" to="/dashboard">Dashboard</Link></li>
                        <li class="nav-item"><Link class="nav-link" to="/tickets">Tickets</Link></li>
                    </ul>
                    <ul class="nav flex-column sticky-top pt-2 mt-3">
                        <li class="nav-item"><Link class="nav-link" to="/assets">Assets</Link></li>
                        <li class="nav-item"><Link class="nav-link" to="/software">Software License</Link></li>
                        <li class="nav-item"><Link class="nav-link" to="/hardware">Hardware</Link></li>
                        <li class="nav-item"><Link class="nav-link" to="/electronics">Electronics</Link></li>
                    </ul> 
                </div>      
        );
    }
}

export default Sidebar;
